import React from 'react';
import logo from './AppLab.png';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function CheckIn() {
  return <h2>Check In</h2>;
}

function CheckOut() {
  return <h2>Check Out</h2>;
}

export default function App() {
  return (
    <Router>
      <div>
        {/* <nav>
          <ul>
            <Link to="/">Home</Link>
          </ul>
        </nav> */}

        <div>
          <div class="row">
            <div class="column">
              <h1> Welcome to the</h1>
              <img src={logo} className="App-logo" alt="logo" />
            </div>
            <div class="column">
              <Link to="/check-in">
                <button type="button">
                  Check In
            </button>
              </Link>
              <br></br>
              <Link to="/check-out">
                <button type="button">
                  Check Out
            </button>
              </Link>
            </div>
          </div>
        </div>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/check-in">
            <nav>
              <ul>
                <Link to="/">Home</Link>
              </ul>
            </nav>
            <CheckIn />
          </Route>
          <Route path="/check-out">
            <nav>
              <ul>
                <Link to="/">Home</Link>
              </ul>
            </nav>
            <CheckOut />
          </Route>
          {/* <Route path="/">
            <Home />
          </Route> */}
        </Switch>
      </div>
    </Router>
  );
}

